import "./Sidebar.css";
const Sidebar = ({ show }) => {
  const SidebarClass = ["sidebar"];

  if (show) {
    SidebarClass.push("show");
  }
  return <div className={SidebarClass.join(" ")}>Sidebar</div>;
};

export default Sidebar;
